const imagem = document.querySelector('#hollow')
const botao = document.querySelector('#botao')

botao.addEventListener('click', funMudar)

function funMudar() {


if(imagem.classList.contains('ocult')) {

    imagem.setAttribute('src','data:image/webp;base64,'
 ) 

 imagem.classList.remove('ocult')
} else {
    imagem.setAttribute('src', 'data:image/webp;base64,')

    
    imagem.classList.add('ocult')
 } }